var readyFun = function() {
  var lang = tenant.language === "hn" ? "es" : tenant.language;
  $require([
    needPolyfill,
    "/jp/npublic/commonjs/language/" + lang + ".js"
  ], function(_, __) {
    $require(["pl_readyload"], function(loader) {
      loader.ready(function() {
        $("div[id^='c_']").each(function() {
          var cid = $(this).attr("id");
          doCompJs(cid);
          getElements(cid).forEach(function(el) {
            var cls = $(el).attr("class").split(/\\s+/).find(c => c.startsWith("e_"));
            doElementJs(cls, function(){}, cid, "", $(el));
          });
        });
      });
    });
  });
};
